import React from 'react'

import './card-list.style.css';

export const Cardlist = props => (
    <div className = 'card-list'>
          {/* between carlibrace{} with can write any java script */}
          <h1>Moe Latt</h1>
          <h1>Htoo Htoo</h1>
          <img src="https://www.google.com/url?sa=i&source=images&cd=&ved=2ahUKEwijo-2KgKnjAhVHslQKHQM5AGwQjRx6BAgBEAU&url=https%3A%2F%2Fwww.pexels.com%2Fsearch%2Fbeautiful%2F&psig=AOvVaw0klX2-DdjCSo9QzSGxm1Eq&ust=1562801682196621" alt=""/>
         {
           props.monsters.map(monsters => (
           <h1 key = {monsters.id}>{monsters.name}</h1>))
         }
    </div>
);
